Company About Us:
Crabtree Farms of Chattanooga is a non-profit urban farm known for:
Growing produce to sell at the Main Street Farmers Market (MSFM) each week, the Rossville Blvd First Friday Market each month, the seasonal on-site Farm Store and through wholesale accounts including local restaurants and shops such as Gaining Ground Grocery; 
Producing over 400 varieties of plant starts for the annual Spring and Fall Plant Sale and Festivals as a means to encourage sustainable plant starts in local gardens throughout our city including vegetables, natives, flowers, medicinal and culinary herbs and fruits and berries, all while providing family-friendly fun on the farm; 
Hosting our annual 100 Dinner farm-to-table meal showcasing top Chattanooga chefs who work their magic to craft a seasonal meal utilizing local foods. In addition, we bring together local distilleries, breweries and meaderies to truly demonstrate the culinary and beverage talent our city has created; 
Offering boutique rental space at the Evelyn Center and surrounding farm grounds for small weddings, parties, corporate retreats and more; 
Offering youth education in the form of regional school field trips, homeschooling programs and specialized programming with youth-serving community organizations. Beyond using standard State of TN and GA curriculum targets to introduce students to food production and pollinators, we work with organizations to create specialized programs such as BIPOC Heritage roles and contributions to sustainable agriculture and land stewardship; 
Offering adult education including hands-on learning through workshare and volunteer programming as well as a selection of adult workshops each month ranging from soap making to permaculture design to herbal remedy making to beekeeping; and 
Providing community gardening spaces, including garden plots for individuals, families and organizations and shared community garden space.

